CREATE TABLE `currency_exchanges` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `from_currency_id` bigint(20) unsigned NOT NULL,
  `to_currency_id` bigint(20) unsigned NOT NULL,
  `minimum_amount_to` decimal(30,15) NOT NULL,
  `maximum_amount_to` decimal(30,15) NOT NULL,
  `normal_normal` tinyint(1) NOT NULL DEFAULT 1,
  `normal_balance` tinyint(1) NOT NULL DEFAULT 1,
  `balance_normal` tinyint(1) NOT NULL DEFAULT 1,
  `balance_balance` tinyint(1) NOT NULL DEFAULT 1,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `from_to_currency_index` (`from_currency_id`,`to_currency_id`),
  KEY `currency_exchanges_to_currency_id_foreign` (`to_currency_id`),
  CONSTRAINT `currency_exchanges_from_currency_id_foreign` FOREIGN KEY (`from_currency_id`) REFERENCES `currencies` (`id`),
  CONSTRAINT `currency_exchanges_to_currency_id_foreign` FOREIGN KEY (`to_currency_id`) REFERENCES `currencies` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=303 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
