INSERT INTO `ec_faq` VALUES (23,'چرا به اکسکوینو اعتماد کنیم؟','<p><font size=\"3\">در شرایط کنونی با وجود خلاء قانونی و نبود مجوز و تاییدیه فعالیت در میان سایت‌های زمینه خرید و فروش ارزهای دیجیتال، تنها راه اعتماد به یک مجموعه، اعتبار شرکت ثبت شده است . \nسایت اکسکوینو، یکی از چندین پروژه استارت آپی شرکت کاوشگران ارتباط نوین یکتاست . آدرس، مشخصات و شماره تماس آن در قسمت ارتباط با ما در سایت نوشته شده است. بنابراین در صورت بروز هرگونه مشکل، در دسترس، پاسخگو و قابل پیگیری هستیم. تمام تلاش تیم اکسکوینو این است که بتواند پاسدار اعتماد شما و امانت دار اموال کریپتوکارنسی شما و البته اعتبار شرکت باشد. همچنین در صورت بروز هرگونه مشکل، می‌توانید با پشتیبانان اکسکوینو تماس حاصل فرمایید.</font></p>','0000-00-00 00:00:00','0000-00-00 00:00:00'),(29,'چرا باید احراز هویت کنیم؟','<p><font size=\"3\">با توجه به زیاد شدن کلاهبرداری‌های سایبری،  پولشوئی و سوء استفاده از اطلاعات و مدارک اشخاص از جمله کارت بانکی، کارت ملی و سایر مدارک شناسایی و به توصیه ی \" پلیس فتا \"  برای جلوگیری از این موارد، کاربران باید بعد از ثبت نام در سایت، برای خرید و فروش یک بار مراحل احراز هویت را انجام دهند. (و در موارد خاص، احتمال درخواست احراز هویت مجدد از کاربر وجود دارد.)\nاطمینان داشته باشید که اطلاعات وارد شده به هیچ عنوان در اختیار شخص سومی قرار نمی‌گیرد مگر در صورت درخواست مراجع قضایی و برای پیگیری جرائم. برای آشنایی بهتر با قوانین اکسکوینو می‌توانید به قسمت <a href=\"https://www.excoino.com/page/privacy-policy\">حفظ حریم خصوصی</a> مراجعه بفرمایید.</font></p>','0000-00-00 00:00:00','0000-00-00 00:00:00'),(30,'در هنگام احراز هویت چه مواردی لازم است؟','<h4>ایمیل: </h4>پس از ثبت نام موفق، بایستی ایمیل شما تایید شود، تا برای مواردی نظیر: ورود به سایت، فراموشی رمز عبور، دریافت رسید انجام تراکنش ، آگاهی از اطلاعیه‌ها ،کمپین‌ها و... از این ایمیل تایید شده استفاده شود. \n<h4>شماره تلفن همراه: </h4>تلفن همراه یکی از راه‌های ارتباطی  با کاربر ،جهت احراز هویت، تایید تراکنش، اطلاع رسانی و... است .\n<h4>شماره تلفن ثابت: </h4>به توصیه پلیس فتا در صورت نیاز به شناسایی و پیگیری موارد احتمالی سوء استفاده، تلفن ثابت برای  احراز هویت الزامی ست.(شماره تلفن ثبت شده باید متعلق به خود شخص یا شخص دیگری که او را تایید می‌کند، باشد)\n<h4>کد ملی: </h4>برای اطمینان از این که تراکنش انجام شده توسط یک شخص حقیقی باشد، ورود کد ملی الزامی ست.\n<h4>کارت بانکی: </h4>برای مبارزه با پولشویی کاربر ثبت نام شده تنها امکان خرید با کارت‌هایی که به نام خودش است و قبل از خرید در سایت ثبت و تایید شده را خواهد داشت.\n<p><font size=\"3\"></font></p>','0000-00-00 00:00:00','0000-00-00 00:00:00'),(31,'عکس خود را چطور و با چه شرایطی ارسال کنم؟','<p><font size=\"3\">عکس خود را با رعایت تمامی موارد خواسته شده در تصویر زیر ارسال نمایید.\n<br><a href=\"https://www.excoino.com/blog/%D9%86%D9%85%D9%88%D9%86%D9%87-%D8%A7%D8%AD%D8%B1%D8%A7%D8%B2/\"> نمونه عکس </a></font></p>','0000-00-00 00:00:00','0000-00-00 00:00:00'),(32,'اگر شاهد مواردی از سوءاستفاده از نام شخص یا مدارک شخص بودیم، چه کنیم؟','<p><font size=\"3\">درصورت مشاهده هرگونه مورد مشکوک به جعل و یا سوءاستفاده، حتما پشتیبانان اکسکوینو را در جریان قرار دهید تا با شخص خاطی مطابق با مواضع قانونی برخورد شود.</font></p>','0000-00-00 00:00:00','0000-00-00 00:00:00'),(33,'چگونه ارز دیجیتال بخرم یا بفروشم؟','<p><font size=\"3\">در بخش داشبورد و یا خرید و فروش، با تغییر حالت دو فیلد \"پرداخت میکنید\" و \"دریافت میکنید\" امکان خرید و فروش و تبدیل ارزهای موجود را خواهید داشت. برای اطلاع از مراحل ایجاد یک تراکنش <a href=\"https://www.excoino.com/blog/%D8%A2%D9%85%D9%88%D8%B2%D8%B4%DB%8C/%D8%A2%D9%85%D9%88%D8%B2%D8%B4-%D8%AE%D8%B1%DB%8C%D8%AF-%D8%A8%DB%8C%D8%AA-%DA%A9%D9%88%DB%8C%D9%86-%D9%81%D8%B1%D9%88%D8%B4-%D8%A8%DB%8C%D8%AA-%DA%A9%D9%88%DB%8C%D9%86/\"> آموزش خرید و فروش در اکسکوینو</a> را مطالعه نمایید.\n</font></p>','0000-00-00 00:00:00','0000-00-00 00:00:00'),(34,'چرا مقداری که سفارش داده شده با مقدار دریافتی متفاوت است؟','<p><font size=\"3\"> مقدار اولیه نمایش داده شده در بخش خرید و فروش برحسب نرخ لحظه و بدون در نظر گرفتن  کارمزد است ، مقدار نهایی دریافتی شما  بر حسب نحوه محاسبه کارمزد ، در صفحه پیش فاکتور و قبل از تایید و پیش به سوی پرداخت نمایش داده خواهد شد. .</font></p>','0000-00-00 00:00:00','0000-00-00 00:00:00'),(35,'تسویه حساب تراکنش چقدر زمان می‌برد؟','<p><font size=\"3\"><h4>تراکنش‌های خرید (دریافت ارز دیجیتال)</h4>\nشما در طول 24 ساعت شبانه روز می‌توانید سفارش خود را ثبت کنید. اما انجام تراکنش‌ها در ساعات کاری (10صبح تا 5 عصر) سریع‌تر صورت خواهد گرفت.\n<h4>تراکنش‌های فروش(دریافت ریال)</h4>\nواریز‌های ریالی از طرف ما (درخواست فروش به سایت یا برداشت ریالی از طرف شما) روزی سه مرتبه در روز‌های کاری انجام می‌شود.\nبه این صورت که سعی می شود سفارش‌های ثبت شده تا قبل از ساعت 9 صبح هر روز کاری نیز در لیست واریز همان روز و سایر سفارش‌های ثبت شده بعد از این ساعت در لیست واریز‌های روز کاری بعدی قرار گیرد. \nپس از واریز از طرف ما (تراکنش‌های تکمیل شده)، شماره پیگیری حواله پایای شما در اطلاعات تراکنش مربوطه درج می‌شود که در این صورت باید منتظر تسویه از سمت بانک باشید.\nواریز‌های ریالی به کاربران به صورت پایا می‌باشد. واریز‌های پایا با استفاده از شماره شبا انجام می‌شود. \nشایان ذکر است واریز مبلغ ریالی به کاربر تنها از طریق شماره شبای مختص هر فرد صورت می‌گیرد و امکان واریز به شماره شبای شخص دیگر یا کارت به کارت وجود ندارد.</font></p>','0000-00-00 00:00:00','0000-00-00 00:00:00'),(36,'برای پیگیری تراکنش های مشکل دار چکار کنیم؟','<p><font size=\"3\">برای پیگیری تراکنش یا هر مساله مربوط به حساب کاربری، حتما از طریق تیکت پشتیبانی اقدام نمایید. بخش تیکت پشتیبانی در پنل کاربری شما قرار دارد.</font></p>','0000-00-00 00:00:00','0000-00-00 00:00:00'),(37,'اکسکوینو چه کیف پول‌هایی دارد؟','<p><font size=\"3\">•	کیف پول بیت کوین</br>\n•	کیف پول بیت کوین کش</br>\n•	کیف پول لایت کوین</br>\nهمان طور که اکسکوینو به فکر رفاه حال کاربر است، در تلاش است تا بتواند تعداد کیف پول‌های خود را افزایش دهد تا کاربران برای نگهداری ارز دیجیتال خود شرایط بهتر و ایمن‌تری داشته باشند.</font></p>','0000-00-00 00:00:00','0000-00-00 00:00:00'),(38,'چطور می‌توانم آدرس کیف پول خود را داشته باشم؟','<p><font size=\"3\">با مراجعه به بخش مدیریت کیف پول و زدن گزینه دریافت مقابل هر ارز، آدرس کیف پول مربوط به هر ارز را دریافت کنید.</font></p>','0000-00-00 00:00:00','0000-00-00 00:00:00'),(39,'حداقل و حداکثر خرید چقدر است؟','<p><font size=\"3\"><h6>حداقل: </h6>حداقل میزان سفارش هر ارز، در زیر فیلد دریافت میکنید ، جهت  اطلاع نوشته شده است. نرخ تبدیل نیز در زیر  فیلد پرداخت می‌کنید قرار دارد که بر اساس قیمت‌های ارائه شده در صفحه اصلی در هر لحظه مقدار دهی می‌شود. \n<h6>حداکثر: </h6>حداکثر میزان سفارش هر ارز، برحسب تراکنش‌های روز، در بازه زمانی ثبت سفارش متغییر است و درصورتی که موجودی ارز مد نظر پایین‌تر از میزان سفارش شما باشد، پیام لازم را  قبل از تایید و پرداخت سفارش دریافت خواهید کرد.</font></p>','0000-00-00 00:00:00','0000-00-00 00:00:00'),(40,'اکسکوینو چه ارزهای دیجیتالی را برای خرید و فروش دارد؟','<p><font size=\"3\">اکسکوینو تعدادی از برترین ارزهای دیجیتال که در حال مبادله شدن  در دنیای امروز است را داراست.\nاز جمله : بیت کوین / اتریوم / ریپل /  بیت کوین کش / لایت کوین و همچنین پرفکت مانی و ئی ووچر</font></p>','0000-00-00 00:00:00','0000-00-00 00:00:00'),(41,'چطور می‌توانم حساب کاربری خود را حذف کنم؟','<p><font size=\"3\">راهی برای حذف حساب کاربری وجود ندارد. بنابراین هر زمان که دوست داشته باشید می‌توانید وارد حساب کاربری تان شوید و تراکنش انجام دهید.</font></p>','0000-00-00 00:00:00','0000-00-00 00:00:00'),(42,'ساعات کاری پشتیبانی اکسکوینو چه زمانی ست؟','<p><font size=\"3\">همکاران ما در واحد پشتیبانی از8:30صبح تا 10 شب پاسخگوی شما هستند. در صورت بروز هر گونه مشکل یا داشتن سوال، با همکاران پشتیبان ما تماس بگیرید.</br>\nراه‌های ارتباط با واحد پشتیبانی:</br>\nشماره تلفن رسمی اکسکوینو: 26602274 – 021</br>\nتنها آی دی تلگرام پشتیبانان:<a href=\"https://t.me/excoino_admin\">@excoino_admin </a></br>\nایمیل پشتیبانی اکسکوینو: <a href=\"support@excoino.net\">support@excoino.net</a></font></p>','0000-00-00 00:00:00','0000-00-00 00:00:00');
