INSERT INTO `ec_pages` VALUES (1,'قوانین و مقررات','terms-of-service','<h1><strong>قوانین و شرایط استفاده از سایت اکسکوینو&nbsp;</strong><strong><span dir=\"LTR\">excoino</span></strong></h1>\n\n<h1>&nbsp;</h1>\n\n<p><strong>این متن قوانین و قرارداد بین سایت اینترنتی اکسکوینو دات کام (</strong><strong><span dir=\"LTR\">excoino</span></strong><strong>)</strong><strong> </strong><strong>و هر کاربری است به نحوی از خدمات مختلف سایت استفاده می کند. در این قرارداد حقوق سایت اکسکوینو و شرایط استفاده از آن و حقوق کاربر قید شده است. کاربر سایت اکسکوینو&nbsp;باید این قوانین را به طور کامل بخواند و بفهمد و بپذیرد. این حق برای سایت اکسکوینو&nbsp;محفوظ است که در هر زمان که بخواهد مفاد این قرارداد را تغییر دهد</strong><strong><span dir=\"LTR\">.</span></strong></p>\n\n<p>&nbsp;</p>\n\n<p>استفاده از هرگونه امکانات اکسکوینو - ثبت نام - خرید - فروش و هر گونه امکانات دیگر به این معنی است که شما مفاد این قرارداد را کاملا خوانده و فهمیده و قبول کرده اید. اگر با مفاد این قرارداد موافق نیستید حق استفاده از امکانات اکسکوینو را ندارید<span dir=\"LTR\">.</span></p>\n\n<p>طرفین قرارداد سایت اینترنتی اکسکوینو دات کام و به عنوان دهنده ی خدمات و کاربر سایت به عنوان گیرنده ی خدمات می باشند<span dir=\"LTR\">.</span></p>\n\n<p>&nbsp;</p>\n\n<p>مفاد قرارداد:</p>\n\n<p><strong>تعاریف و واژگان:</strong></p>\n\n<p>1-اکسکوینو&nbsp;سایت اینترنتی می باشد که تحت همین دامنه <span dir=\"LTR\">excoino&nbsp;</span>&nbsp;از طریق اینترنت قابل دسترس می باشد. این سایت برای کاربران ایرانی تحت قوانین جمهوری اسلامی ایران هستند و از کلیه ی قوانین جمهوری اسلامی ایران تبعیت می کند<span dir=\"LTR\">.</span></p>\n\n<p>2-کاربر کسی است که بنابه اراده ی خود از سایت اکسکوینو دات نت بازدید می کند و بدون هیچ گونه اجبار از خدمات این سایت استفاده می کند.</p>\n\n<p>3-ارز الکترونیکی مانند وب مانی - پی پال - پرفکت مانی - بیت کوین یک ابزار مالی بدون بهره است که مورد خرید فروش قرار می گیرد و از آن می توان در سایت های پذیرنده به عنوان یک حواله ی پولی یا ژتون ارزش دار استفاده کرد<span dir=\"LTR\">.</span></p>\n\n<p>4-ارز الکترونیکی مورد قبول آنهایی است که در سایت اکسکوینو لیست شده و مورد پذیرش سایت اکس کوینو برای خرید و فروش می باشد<span dir=\"LTR\">.</span>پرداخت وجه عبارت است از انتقال وجه - ریالی یا دلار - یا به صورت معادل ارز الکترونیکی از پرداخت کننده ی وجه به گیرنده ی وجه.</p>\n\n<p>5-روش پرداخت عبارت است از هر روشی که برای انتقال وجه در اکسکوینو مجاز شمرده شده است. پرداخت می تواند توسط ارز الکترونیکی یا انتقال بانکی حضوری یا اینترنتی یا توسط کارتهای شتابی از درگاه بانکی اکسکوینو و یا انتقال بین المللی بانکی از طریق سوییفت یا دیگر روش های پرداخت باشد.</p>\n\n<p><strong>اکسکوینو خدمات زیر را برای کابر فراهم می سازد:</strong></p>\n\n<p>-تبدیل یک ارز الکترونیکی به ارز الکترونیکی دیگر با نرخ تبدیل معین و کارمزد معین و حداقل و حداکثر معین.</p>\n\n<p>-فروش ارز الکترونیکی به کاربر و دریافت مبلغ معینی وجه پول رایج از وی.</p>\n\n<p>-خرید ارز الکترونیکی از کاربر و پرداخت مبلغ میعنی وجه رایج به وی.</p>\n\n<p>- اکسکوینو خدمات خود را برای هر ارز الکترونیکی که در سایت لیست شده است و ممکن است طبق شرایط مختلف و به دلخواه اکس کوینو تغییر نماید به هر کاربر که بخواهد و منع قانونی نداشته باشد ارائه می کند<span dir=\"LTR\">.</span></p>\n\n<p><strong>با استفاده از خدمات اکسکوینو کاربر می پذیرد که<span dir=\"LTR\">:</span></strong></p>\n\n<p>1-کاربر می پذیرد که منبع و مقصد کلیه ی ارزهای الکترونیکی و غیر الکترونیکی ارائه شده توسط وی در تراکنش های سایت اکسکوینو کاملا قانونی و مطابق با قوانین بین المللی و مقررات جمهوری اسلامی ایران باشند</p>\n\n<p>2-کاربر می پذیرد که مالک قانونی وجوه و حساب هایی است که وی در هر سفارش به هر نحو چه برای پرداخت و چه برای دریافت از آنها استفاده کرده می باشد.</p>\n\n<p>3-اِکسکوینو از ارائه خدمات به اشخاص با هویت پنهان و احراز نشده، معذور است.</p>\n\n<p>4- حداقل سن برای ثبت نام ،&nbsp;احراز هویت و فعالیت در اکسکوینو 18 سال تمام می باشد.</p>\n\n<p>5-قرار دادن حساب کاربری خود در اختیار اشخاص دیگر ( حساب بانکی اجاره ای ، اطلاعات کاربری و...)&nbsp;درصورت محرز شدن , موجب مسدود شدن حساب کاربری ،&nbsp;و هرگونه عواقب ناشی این امر بر عهده کاربر می باشد.</p>\n\n<p>6-قوانین در موارد زیادی و بسته به شرایط و قوانین جمهوری اسلامی ممکن است تغییر کند و وب سایت اطلاع رسانی در موارد تغییر اعلام می نماید و کاربر موظف به مطالعه آن ها در زمان هر خرید می باشد.</p>\n\n<p>7-کاربر موظف است قبل از ورود به درگاه و پرداخت ارز یا ریال خود ، پیش فاکتور ارائه شده را با دقت مطالعه کند و با آگاهی کامل سفارش و قوانین را تایید و وارد درگاه شود . در صورت اعتراض به کسر کارمزد یا نا آگاهی ، سایت اکسکوینو هیچ مسئولیتی درباره اشتباهات کاربر را نمی پذیرد.</p>\n\n<p>8- کاربر موطف است از طریق کارت هایی که در سایت ثبت و تایید شده اند خرید نماید ، در صورت خرید با کارت ثبت نشده و تاخیر در انجام تراکنش متوجه کاربر خواهد بود و اکسکوینو هیچ مسئولیتی در این مورد ندارد.</p>\n\n<p>9- درصورت خرید با کارت های بانکی غیر مجاز که متعلق به شما نباشد ، اکسکوینو موظف به دریافت اطلاعات حساب اصلی و صاحب حساب و (در صورت صلاحدید ، اکسکوینو&nbsp; میتواند درخواست نامه قضایی داشته باشد)&nbsp;&nbsp;و عودت وجه&nbsp;طی 48 تا 72 ساعت کاری بعد از دریافت اطلاعت می باشد.&nbsp;&nbsp;</p>\n\n<p>10- کاربر موظف است سفارش خود را با دقت کامل ثبت نماید ، در صورت هرگونه اشتباه، امکان لغو ، برگشت وجه یا ارز امکان پذیر نمی باشد.</p>\n\n<p>&nbsp; &nbsp;10-1&nbsp; در صورت واریز مبلغ یا مقدار متفاوت با سفارش از طرف اکسکوینو یا کاربر (مقدار بیشتر یا کمتر)&nbsp;، و یا واریز به ادرس متفاوت با سفارش ، هردو طرف بدون قید و شرط موظف به اصلاح و تسویه تراکنش بر طبق سفارش می باشند.</p>\n\n<p>&nbsp; &nbsp;10-2&nbsp; هر ادرس کیف پول های رمز ارز کاربر فقط و فقط متعلق به آن رمز ارز می باشد و به علت شباهت ادرس بعضی رمز ارزها به یگدیگر، در صورت واریز اشتباه رمز ارز دیگری به ادرس مشخص شده ، تمام مسئولیت واریز اشتباه بر عهده کاربر می باشد و اکسکوینو هیچ مسئولیتی در قبال اشتباه واریز کاربر ندارد.</p>\n\n<p>11- اگر مبلغ واریزی کاربر به سایت ( چه ریالی و چه رمز ارز و..) بعد از محدوده ی زمانی سفارش باشد ،&nbsp; به هیچ عنوان تراکنش قبلی فعال نخواهد شد.</p>\n\n<p>12-سفارش هایی که از طرف سایت انجام شده و شماره تراکنش یا پیگیری آن ثبت شده است به منزله تکمیل سفارش می باشد و از سوی سایت انجام شده است. در صورتی که ادرس کیف پول ارز یا شماره شبای ارسالی اشتباه باشد، مسئولیت آن متوجه خود کاربر می باشد و سایت هیچگونه تعهدی نسبت به ارسال مجدد، تاخیر&nbsp;یا برگشت سفارش را ندارد.</p>\n\n<p>13- کاربر برای دریافت ریال ، باید شماره شبای خود را ثبت کند ، در صورت ثبت شماره شبا به اسم افراد دیگر مسئولیت واریز وجه با خود کاربر می باشد.&nbsp;</p>\n\n<p>&nbsp; &nbsp;13-1 اکسکوینو واریز ریالی به حساب کاربران را حداکثر تا یک&nbsp;روز کاری در سه بازه ی زمانی ارسال و شماره پیگیری در تراکنش مربوطه درج می شود.&nbsp;</p>\n\n<p>&nbsp; &nbsp;13-2 در صورتی که واریز های ریالی برای کاربران به علت محدودیت های بانکی ، سقف واریزی و دلایل دیگر با تاخیر زمانی&nbsp;انجام شود ، کاربر نمی تواند غیر از ادعای عدم دریافت ریال از سوی اکسکوینو، هیچگونه ادعا و یا درخواست دیگری از قبیل لغو کردن تراکنش و یا درخواست مبلغ بیشتری نماید.&nbsp;</p>\n\n<p>14- در صورتی که کاربری چندین سفارش دریافت ریال در روز داشته باشد امکان دارد تمام واریز ها در قالب یک تراکنش ریالی برای شبای مقصد واریز شود.</p>\n\n<p>15-فرآیند احراز هویت شامل گردآوری اطلاعاتی از کاربر من جمله شماره تماس ثابت - آی پی - آدرس - کارت شناسایی با تصویر - کد ملی و اطلاعات بانکی وی می باشد.این اقدامات حریم شخصی وی را نقض نخواهد کرد و به هیچ شخص ثالثی ارائه نخواهد شد <span dir=\"LTR\">&nbsp;</span>مگر با نامه ی قضایی و یا درخواست کتبی پلیس محترم فتای جمهوری اسلامی ایران.</p>\n\n<p>16- سایت اکسکوینو مجاز است برای اطمینان از صحت تراکنش ها از کاربران اطلاعات بیشتری برای احراز هویت شخص و تراکنش های کاربر را درخواست کند.</p>\n\n<p>17-نرخ تبدیل و قیمت تبدیل ارزهای الکترونیکی مختلف توسط اکسکوینو تعیین می شوند و در روی سایت توسط کلیه ی کابران قابل مشاهده خواهند و در هنگام سفارش نیز مبلغ دریافتی کاربر بعد از تکمیل سفارش با کسر کارمزد ها و با اعمال نرخ تبدیل به طور کامل و شفاف و دقیق به وی نمایانده می شوند<span dir=\"LTR\">.</span></p>\n\n<p>18-تصمیم راجع به موفق یا ناموفق بودن احراز هویت فقط و فقط در اختیار اکسکوینو خواهد بود و سایت اکسکوینو می تواند یک احراز هویت را به تشخیص خود قبول کند یا قبول نکند.</p>\n\n<p>19-هر گونه کارمزد ، کمیسیون و هزینه ی دیگر که سیستم یا ارز الکترونیکی به کاربر تحمیل نماید فقط و فقط بر عهده ی کاربر خواهد بود و اکسکوینو هیچ گونه مسئولیتی راجع به این گونه هزینه ها نمی پذیرد.</p>\n\n<p>20- واریز معادل ارزهای خریداری شده در اولین و سریعترین زمان در ساعات اداری واریز می شوند. در ساعات غیر اداری ممکن است واریز به کمی تاخیر انجام شود. واریز معادل آلت کوین ها (اتریوم ، ریپل و...) ممکن است زمان بیشتری طول بکشند.</p>\n\n<p>21- معادل ریالی ارزهای فروخته شده به اکسکوینو در اولین روز اداری، روزانه سه بار از طریق سیستم پایا واریز می گردد و کاربران با توجه با بازه ی زمانی بانک حساب خودشان معادل ریالی را دریافت می کنند. در ساعات غیر اداری یا تعطیل واریز ریالی انجام نمی شود و در شروع اولین روز کاری در لیست واریزی ها قرار می گیرند.</p>\n\n<p>22- اکسکوینو هیچ گونه مسئولیتی راجع به تاخیر، زمان بندی سایت مقصد در دریافت ، و یا تراکنش ناموفق ایجاد شده در انجام سفارش به علت نقص یا مشکل یا تعمیرات سیستم ارز الکترونیکی یا بانک پذیرنده نمی پذیرد<span dir=\"LTR\">.</span></p>\n\n<p>23-&nbsp;اگر تحت شرایطی اکسکوینو، اشتباهاً وجوه یا ارزی را به حساب کاربر منظور یا در محاسبات خود هر نوع اشتباهی نماید، هر زمان مجاز است ؛مستقلاً و بدون انجام هیچ گونه تشریفات و قضائی و دریافت اجازه کتبی از متعهد (صاحب حساب) در رفع اشتباه و برداشت از حساب&zwnj;های وی اقدام نماید و تشخیص اکسکوینو نسبت به وقوع اشتباه یا پرداخت بدون حق و لزوم برداشت از حساب معتبر خواهد بود.</p>\n\n<p>24- بعد از ثبت نام در اکسکوینو امکان تغییر آدرس ایمیل ، نام کاربری و سایر موارد ثبت شده وجود نخواهد داشت ، لطفا در زمان ثبت نام دقت کافی بعمل آورید&nbsp;.</p>\n\n<p>25- اکسکوینو هیچگونه ارتباطی با سایت ها و یا ابزارهای شرط بندی ندارد و در صورت استفاده&nbsp; کاربران با اینگونه سایت ها ، حساب کاربری ایشان مسدود خواهد شد.</p>\n\n<p>26- کاربر می پذیرد که کلیه ی فعالیت های وی و سایت اکسکوینو تحت قوانین جمهوری اسلامی ایران است و فعالیت های وی در هر صورت هر شکل نباید قوانین جمهوری اسلامی ایران را نقض کند ، در صورت نقض قوانین ، سوء استفاده مالی و غیر مالی و هرگونه فعالیت مشکوک ، حساب کاربری فرد مربوطه مسدود و اطلاعات هویتی و مالی کاربر از طریق مراجع قانونی پیگیری قضایی و کاربر بدون قید و شرط متعهد به جبران خسارت خواهد بود.</p>\n\n<p>27- هر گونه پیامدهای مالیاتی ناشی از تراکنش های کاربر با اکسکوینو به عهده ی خود کاربر خواهد بود و اکسکوینو هیچ گونه مسئولیتی نمی پذیرد.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>کاربر می پذیرد که جز در مورد انجام صحیح سفارش طبق قیمت و گزارش تراکنش مشخص و شفاف و کارمزد مشخص و شفاف طبق مطالب فاکتور خرید یا فروش ارائه شده و بند های قرارداد و قوانین فوق هیچ گونه داعیه و طلب و شکایت دیگر عملا و لسانا از سایت اکسکوینو (</strong><strong><span dir=\"LTR\">excoino</span></strong><strong>) </strong><strong>&nbsp;- مدیران - کارمندان - و کلیه ی مرتبطان با این سایت نداشته باشد.</strong></p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>','0000-00-00 00:00:00','0000-00-00 00:00:00'),(2,'حریم خصوصی چیست ؟','privacy-policy','<div class=\"content\" style=\"margin: 0.5em 1.4em; text-align: justify; background-color: rgb(255, 255, 255);\"><div class=\"field field-type-filefield field-field-ct-news-pic\" style=\"color: rgb(0, 84, 96); font-family: Tahoma, sans-serif; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal;\"><div class=\"field-items\"><div class=\"field-item odd\" style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 20px; background: url(&quot;/sites/all/themes/fata/css/images/pattern.gif&quot;) repeat; margin-bottom: 10px; padding-top: 10px;\"><img src=\"https://www.cyberpolice.ir/sites/default/files/imagecache/news400/news/news--fata--privacy.www_.cyberpolic.ir-.jpg\" alt=\"\" title=\"\" width=\"240\" height=\"160\" class=\"imagecache imagecache-news400 imagecache-default imagecache-news400_default\" style=\"text-align: right; border: 1px solid rgb(170, 232, 255); background: none 0px 0px repeat scroll rgb(232, 249, 255); float: left; margin: 9px 15px 15px 6px; padding: 5px;\"></div></div></div><div class=\"field field-type-text field-field-lead\" style=\"color: rgb(0, 84, 96); font-family: Tahoma, sans-serif; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal;\"><div class=\"field-items\"><div class=\"field-item odd\" style=\"text-align: right; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 23px; background: url(&quot;/sites/all/themes/fata/css/images/pattern.gif&quot;) repeat; margin-bottom: 0.9em; padding-top: 10px; margin-top: 0.5em;\">حریم خصوصی افراد در فضای مجازی ممکن است با کنترل کلاهبرداران بر اطلاعات شخصی و دسترسی به اطلاعات کاربر و ایجاد اختلال در آن همراه باشد پس همه کاربران باید هوشیار باشند.</div></div></div><div class=\"rtejustify\" style=\"color: rgb(0, 84, 96); font-family: Tahoma, sans-serif; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; text-align: right;\"><span dir=\"RTL\">جوامع آنلاین از زمان پیدایش دهکده جهانی اینترنت به وجود آمده به طوری که مردم سراسر جهان این امکان را دارند که با یکدیگر مراوده داشته باشند، این شبکه‌</span><span dir=\"RTL\">های ارتباطی تا به امروز با شیوه­</span>‌<span dir=\"RTL\">های مختلفی مانند تارنمای شبکه­</span>‌<span dir=\"RTL\">های اجتماعی توسعه یافته، پیام، عکس، فیلم و ... بین کاربران به اشتراک گذاشته می شود. این شبکه­</span>‌<span dir=\"RTL\">های ارتباطی آنلاین مزایای بسیاری دارد و می­‌تواند خیلی مفید باشد در عین حال و در صورت عدم رعایت نکات امنیتی، موجب دسترسی افراد غیرمجاز به اطلاعات خصوصی می­</span>&nbsp;<span dir=\"RTL\">شود و خسارت جبران‌ناپذیری به حریم خصوصی کاربران وارد می­‌نمایند</span>.&nbsp;</div><div style=\"text-align: right;\"><span style=\"color: rgb(0, 84, 96); font-family: Tahoma, sans-serif; font-size: 12px;\"><br></span></div><span style=\"color: rgb(0, 84, 96); font-family: Tahoma, sans-serif; font-size: 12px; border-style: initial; border-color: initial; border-image: initial;\"><div style=\"text-align: right;\"><img alt=\"\" src=\"https://www.cyberpolice.ir/sites/default/files/sites/default/files/file_attach/2017-09-26_092255_1.jpg\" style=\"border: 0px; width: 550px; height: 289px;\"></div></span><div class=\"rtejustify\" style=\"text-align: right; color: rgb(0, 84, 96); font-family: Tahoma, sans-serif; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal;\"><span dir=\"RTL\">حریم خصوصی هر فردی قلمرو زندگی شخصی او به حساب می­</span>‌<span dir=\"RTL\">آید، ورود به این حریم نباید بدون رضایت اشخاص باشد. امروزه فن‌آوری‌‌های اطلاعات و ارتباطات نوظهور یکی از تهدیدات حریم‌خصوصی کاربران می باشد. از یک‌سو، اینترنت دسترسی به داده‌‌های شخصی، هم چنین تحریف و تخریب آن‌‌‌ها و بهره‌برداری از هویت اشخاص و انتشار این اطلاعات را برای اهداف غیر‌مجاز تسهیل می‌کند و از سوی دیگر، امکان ردیابی اطلاعات مرتبط با هویت فرد را فراهم می‌سازد که کلاهبردارن و سارقان اینترنتی با سوء‌استفاده از این اطلاعات اقدام به فروش یا باجگیری می­</span>‌<span dir=\"RTL\">نمایند. با توجه به اینکه امنیت حریم‌خصوصی بسیار مهم می‌</span><span dir=\"RTL\">باشد، باید به میزان و نوع ارتباطات توجه خاصی شود و تلاش شود امنیت را در تجهیزات و سیستم‌­های مورد استفاده افزایش دهیم</span>.</div><span style=\"color: rgb(255, 0, 0); font-family: Tahoma, sans-serif; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal;\"><div style=\"text-align: right;\"><span dir=\"RTL\">برخی از نقض‌های &nbsp;حریم‌خصوصی در فضای مجازی</span>:</div></span><div class=\"rtejustify\" style=\"text-align: right; color: rgb(0, 84, 96); font-family: Tahoma, sans-serif; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal;\"><span dir=\"RTL\">دسترسی غیرمجاز به داده های رایانه ای یا مخابراتی، نشر اکاذیب و انتشار و فروش داده‌</span><span dir=\"RTL\">ها نمونه­</span>‌<span dir=\"RTL\">هایی از مصادیق تجاوز به حریم‌خصوصی می­</span>‌<span dir=\"RTL\">باشد که طبق قوانین جرایم رایانه­‌ای کشور برای هر کدام مجازاتی تعریف شده است</span>.&nbsp;</div><div style=\"text-align: right;\"><br></div><span style=\"color: rgb(0, 84, 96); font-family: Tahoma, sans-serif; font-size: 12px; border-style: initial; border-color: initial; border-image: initial;\"><div style=\"text-align: right;\"><img alt=\"\" src=\"https://www.cyberpolice.ir/sites/default/files/sites/default/files/file_attach/2017-09-26_092103_0.jpg\" style=\"border: 0px; width: 550px; height: 363px;\"></div></span><div class=\"rtejustify\" style=\"color: rgb(0, 84, 96); font-family: Tahoma, sans-serif; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal;\"><div style=\"text-align: right;\">۱<span dir=\"LTR\">-&nbsp;</span>دسترسی غیرمجاز به داده‌های رایانه‌ای یا مخابراتی نظیر هک ایمیل یا اکانت افراد</div><div style=\"text-align: right;\">۲<span dir=\"LTR\">-&nbsp;</span>شنود غیرمجاز محتوای در حال انتقال در سیستم‌های رایانه‌ای یا مخابراتی نظیر استفاده از نرم افزارهای شنود چت‌های اینترنتی</div><div style=\"text-align: right;\">۳<span dir=\"LTR\">-&nbsp;</span>دسترسی غیرمجاز به داده‌های سری در حال انتقال در سیستم‌های رایانه‌ای یا مخابراتی یا حامل‌های داده یا تحصیل و شنود آن</div><div style=\"text-align: right;\">۴<span dir=\"LTR\">-&nbsp;</span>در دسترس قرار دادن داده‌های سری در حال انتقال در سیستم‌های رایانه‌ای یا مخابراتی یا حامل‌های داده برای اشخاص فاقد صلاحیت</div><div style=\"text-align: right;\">۵<span dir=\"LTR\">-&nbsp;</span>نقض تدابیر امنیتی سیستم‌های رایانه ای یا مخابراتی به قصد دسترسی به داده‌های سری در حال انتقال در سیستم‌های رایانه‌ای یا مخابراتی یا حامل‌های داده</div><div style=\"text-align: right;\">۶<span dir=\"LTR\">-&nbsp;</span>حذف یا تخریب یا مختل یا غیرقابل پردازش نمودن داده‌های دیگری از سیستم‌های رایانه‌ای یا مخابراتی یا حامل‌های داده بطور غیرمجاز</div><div style=\"text-align: right;\">۷<span dir=\"LTR\">-&nbsp;</span>از کار‌ انداختن یا مختل‌ نمودن سیستم‌های رایانه‌ای یا مخابراتی بطور غیرمجاز نظیر غیرفعال‌سازی دیتابیس، تارنماها و ممانعت از دسترسی افراد به سایت‌های شخصی</div><div style=\"text-align: right;\">۸<span dir=\"LTR\">-&nbsp;</span>ممانعت از دسترسی اشخاص مجاز به داده‌ها یا سیستم‌های رایانه‌ای یا مخابراتی بطور غیرمجاز</div><div style=\"text-align: right;\">۹<span dir=\"LTR\">-&nbsp;</span>ربودن داده‌های متعلق به دیگری بطور غیرمجاز</div><div style=\"text-align: right;\">۱۰<span dir=\"LTR\">-&nbsp;</span>هتک حیثیت از طریق انتشار صوت و فیلم تحریف شده دیگری بوسیله سیستم‌های رایانه‌ای یا مخابراتی</div><div style=\"text-align: right;\">۱۱<span dir=\"LTR\">-&nbsp;</span>نشر اکاذیب از طریق سیستم‌های رایانه‌ای یا مخابراتی به قصد تشویش اذهان عمومی<span dir=\"LTR\">.</span></div></div><div class=\"field field-type-link field-field-ct-news-src\" style=\"color: rgb(0, 84, 96); font-family: Tahoma, sans-serif; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal;\"><div class=\"field-items\"><div class=\"field-item odd\" style=\"text-align: right; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 20px; background: url(&quot;/sites/all/themes/fata/css/images/pattern.gif&quot;) repeat; margin-bottom: 10px; padding-top: 10px;\"><div class=\"field-label-inline-first\" style=\"font-weight: bold; display: inline;\">منبع:&nbsp;</div>&nbsp;<a href=\"http://www.cyberpolice.ir/\" target=\"_blank\" rel=\"منبع خبر\" style=\"text-decoration-line: none; color: rgb(0, 64, 128);\">پایگاه اطلاع رسانی پلیس فتا</a></div></div></div></div><br>','0000-00-00 00:00:00','0000-00-00 00:00:00'),(3,'درباره ما','about','<p>اکسکوینو یک استارت آپ زیر مجموعه شرکت دانش بنیان توسعه فناوری آرین داده پیوسته ایرانیان (وابسته به هولدینگ کاوشگران نوین ارتباط یکتا) میباشد. تیم اکسکوینو با ارائه کیف پول ارز دیجیتال و به وجود آوردن بستری امن&zwnj;، با رابط کاربری آسان برای <a href=\"https://www.excoino.com/login/\"> خرید و فروش ارز دیجیتال</a> در حال فعالیت است و تلاش می&zwnj;کند تا زمینه&zwnj;ای فراهم آورد که فعالان این عرصه بتوانند با هر نوع رمز ارزی که دارند، هر تعداد تراکنشی که می خواهند، در روز انجام دهند.این شرکت با گرد هم آوردن یک تیم مجرب از متخصصین حوزه فناوری&zwnj;، امنیت&zwnj;، شبکه و محتوا در حوزه ارز دیجیتال، توانسته در مدت زمان کوتاهی اعتماد مخاطبان زیادی را به خود جلب کند تا فعالان ارز دیجیتال بتوانند با احساس امنیت بالا در این زمینه فعالیت کنند.</p>\n\n<p>این تیم تلاش می کند تا به صورت جدی خط مشی های <a href=\"https://www.excoino.com/page/privacy-policy\">حفظ حریم خصوصی </a> را دنبال کند و با شفافیت در انتقال اطلاعات و جلوگیری از سو استفاده کلاهبرداران، به امن ترین مکان برای تبادل ارز های دیجیتال در ایران تبدیل شود.</p>','0000-00-00 00:00:00','0000-00-00 00:00:00'),(11,'نماد اعتماد الکترونیکی','enamad','<p>باتوجه فعالیت در زمینه خدمات ارزها کاربران و مراجعه کنندگان عزیز از سایت انتظار قرار دادن نماد اعتماد اکترونیک را دارند<span dir=\"LTR\">.</span></p>\n\n<p>سایت&nbsp;excoino&nbsp;اقدام به دریافت نماد اعتماد نموده است. متاسفانه طبق قانون مرکز توسعه تجارت الکترونیکی،&nbsp; به سایت های&nbsp; ارز اینترنتی نماد اعتماد الکترونیک تعلق نمی گیرد<span dir=\"LTR\">.</span>لازم به ذکر است سایت دیگر ما، یعنی<span dir=\"LTR\">&nbsp;<a href=\"http://connecta.ir\">سایت کانکتا</a>&nbsp;</span>دارای نماد اعتماد الکترونیک می باشد. این بدان معناست که دریافت نماد مجدد و یا درخواست انتقال آن به&nbsp;excoino&nbsp;بسیار ساده است ولی باتوجه به قانون این امر امکان پذیر نمی باشد<span dir=\"LTR\">.</span></p>\n\n<p>با تشکر ، اکسکوینو</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>','0000-00-00 00:00:00','0000-00-00 00:00:00'),(12,'تماس باما','contact-us','<p><strong>اکسکوینو Excoino</strong><br />\nخرید و فروش بیت کوین ارزان، اتریوم ، ریپل ، پرفکت مانی و سایر ارزها</p>\n\n<p><br />\nخرید و فروش بیت کوین و سایر ارزها<br />\nامکان تبدیل ارزها<br />\nکیف پول رایگان برای نگهداری ارزها<br />\nپشتیبانی از طریق تلگرام و تیکت<br />\nامنیت و سرعت در استفاده از خدمات<br />\nنکته:</p>\n\n<p>1.کلیه فعالیت های این مجموعه در حوزه پولهای الکترونیک و از محل درآمدهای قانونی مشتریان خود در خارج کشور بوده و هیچ گونه ارتباطی با دلار فیزیکی اسکناس یا حواله ندارد.&nbsp;</p>\n\n<p>2. این مجموعه تحت هیچ شرایطی در حوزه فعالیت مرتبط با صرافی ها از جمله خرید و فروش و اعلام نرخ ارز اسکناس یا حواله ورود پیدا نکرده و نخواهد کرد.</p>\n\n<p>3. این مجموعه بدون تایید هویت افراد هیچ گونه خدماتی ارائه نخواهد داد.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>آدرس</strong>: تهران-کامرانیه جنوبی-بن بست مریم -پلاک 1</p>\n\n<p><strong>تلفن </strong>: 02122201549 -02122235812</p>\n\n<p><strong>ایمیل : support@excoino.net</strong></p>\n\n<p>&nbsp;</p>\n\n<p><strong><a href=\"https://t.me/excoino_admin\">پشتیبانی آنلاین تلگرام</a></strong>&nbsp;&nbsp; <a href=\"https://t.me/excoino\">کانال تلگرام</a></p>','0000-00-00 00:00:00','0000-00-00 00:00:00'),(13,'توصیه های پلیس فتا','fata_police','<p style=\"font-size: 12px; font-family: Arial, Verdana; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; box-sizing: border-box; color: rgb(0, 84, 96); background-color: rgb(255, 255, 255);\"></p><div style=\"font-size: 10pt; font-family: Arial, Verdana; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; text-align: right;\"><strong style=\"box-sizing: border-box; text-align: justify; font-size: large; color: rgb(255, 153, 0); font-family: Tahoma;\"><img src=\"data:image/jpeg;base64,\"></strong></div><span style=\"font-size: 10pt; font-family: Tahoma; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal;\"><h3 style=\"text-align: center;\"><strong>&nbsp;9 نکته درمورد خرید اینترنتی</strong></h3></span><span style=\"font-size: 10pt; font-family: Tahoma; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal;\"><div style=\"text-align: right;\">&nbsp;</div></span><span style=\"font-size: 10pt; font-family: Tahoma; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal;\"><div style=\"text-align: right;\">نکات ارائه شده در قسمت ذیل می تواند به اشخاص در زمان خرید اینترنتی کمک کند تا به راحتی و با امنیت بیشتر اقدام به خرید اینترنتی نمایند.</div></span><span style=\"font-size: 10pt; font-family: Tahoma; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal;\"><div style=\"text-align: right;\">&nbsp;</div></span><span style=\"font-size: 10pt; font-family: Tahoma; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; color: rgb(0, 0, 255);\"><div style=\"text-align: right;\"><strong>1- &nbsp;شخصی که با او معامله می کنید، را بشناسید.</strong></div></span><span style=\"font-size: 10pt; font-family: Tahoma; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal;\"><div style=\"text-align: right;\">&nbsp;● &nbsp;قبل از این که خریدی انجام دهید، آدرس و شماره تلفن واقعی فروشنده اینترنتی را بررسی کنید و نسبت به صحت آن اطمینان حاصل نمایید. به این منظور که اگر بعداً برای شما سوالی پیش بیاید و یا به مشکلی برخورد کنید، این آدرس و شماره تلفن در دست شما است و می توانید به آنها مراجعه کنید.</div></span><span style=\"font-size: 10pt; font-family: Tahoma; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal;\"><div style=\"text-align: right;\">&nbsp;</div></span><span style=\"font-size: 10pt; font-family: Tahoma; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; color: rgb(0, 0, 255);\"><div style=\"text-align: right;\"><strong>2- کالائی را که در حال خرید آن هستید، بشناسید.</strong></div></span><span style=\"font-size: 10pt; font-family: Tahoma; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal;\"><div style=\"text-align: right;\">● &nbsp;یک نسخه نهایی از شرایط و ویژگی های محصول را که فروشنده تهیه کرده است، را به دقت مطالعه کنید حتی اگر این کار برای شما خسته کننده و ملال آور باشد.</div></span><span style=\"font-size: 10pt; font-family: Tahoma; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal;\"><div style=\"text-align: right;\">● &nbsp;شرایط و ویژگی ها را به دقت بررسی کنید. اگر شما از محصول راضی نیستید، آیا می توانید آن را برگردانده و پول خود را دریافت کنید؟ هر نوع اطلاعات ثبت شده که مربوط به این معامله است و شامل تمامی نامه های الکترونیک ارسالی به فروشنده و دریافتی از فروشنده است، را ذخیره کرده و از آنها پرینت بگیرید.&nbsp;</div></span><span style=\"font-size: 10pt; font-family: Tahoma; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal;\"><div style=\"text-align: right;\">● &nbsp;کارت های هدیه را از مراکزی که می شناسید و به آنها اعتماد دارید، تهیه کنید. از خرید کارت از سایت هایی که مانند یک حراجی کار می کنند، خودداری کنید. زیرا این کارت ها می توانند تقلبی باشند.&nbsp;</div></span><span style=\"font-size: 10pt; font-family: Tahoma; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal;\"><div style=\"text-align: right;\">&nbsp;</div></span><span style=\"font-size: 10pt; font-family: Tahoma; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; color: rgb(0, 0, 255);\"><div style=\"text-align: right;\"><strong>3- در حفاظت از اطلاعات شخصی خود حساس باشید.</strong></div></span><span style=\"font-size: 10pt; font-family: Tahoma; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal;\"><div style=\"text-align: right;\">● اطلاعات کارت اعتباری خود یا سایر اطلاعات مالی خود را در ازای خرید و دریافت جدیدترین اسباب بازی، کارت هدیه رایگان، یک شغل فصلی و یا اجاره (یک محل) برای تعطیلات در اختیار شخصی که نمی شناسید، قرار ندهید.&nbsp;</div></span><span style=\"font-size: 10pt; font-family: Tahoma; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal;\"><div style=\"text-align: right;\">● اطلاعات مالی خود را از طریق نامه الکترونیک ارسال نکنید. نامه الکترونیک روشی مطمئن برای انتقال شماره کارت اعتباری، شماره حساب بانکی و یا شماره تامین اجتماعی نیست.&nbsp;</div></span><span style=\"font-size: 10pt; font-family: Tahoma; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal;\"><div style=\"text-align: right;\">● بر روی لینک موجود در نامه الکترونیک کلیک نکنید. شرکت هایی که فعالیت آنها مشروع و قانونی است، اطلاعات مالی شما را از طریق نامه الکترونیک یا پیام های پاپ آپ درخواست نمی کنند.</div></span><span style=\"font-size: 10pt; font-family: Tahoma; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal;\"><div style=\"text-align: right;\">&nbsp;</div></span><span style=\"font-size: 10pt; font-family: Tahoma; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; color: rgb(0, 0, 255);\"><div style=\"text-align: right;\"><strong>4 - سیاست حفظ اسرار را به دقت مطالعه و بررسی کنید.&nbsp;</strong></div></span><span style=\"font-size: 10pt; font-family: Tahoma; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal;\"><div style=\"text-align: right;\">● &nbsp;سیاست حفظ اسرار ممکن است طولانی باشد و خواندن آن زمان بر باشد، اما می تواند اطلاعات مهمی را در اختیار شما قرار دهد. برای مثال وب سایت چه نوع اطلاعات شخصی را جمع آوری می کند، صاحبان و اپراتورهای سایت چگونه قصد دارند از این اطلاعات استفاده کنند. اگر نمی توانید سیاست حفظ اسرار سایت را پیدا کنید و یا آن را درک نمی کنید و مفاد آن را متوجه نمی شوید، به فکر انجام معاملات تجاری خود در جای دیگری باشید و بگذارید که سایت (صاحبان سایت ) بداند شما چه فکر و نظری دارید.</div></span><span style=\"font-size: 10pt; font-family: Tahoma; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal;\"><div style=\"text-align: right;\">&nbsp;</div></span><span style=\"font-size: 10pt; font-family: Tahoma; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; color: rgb(0, 0, 255);\"><div style=\"text-align: right;\"><strong>5- حواشی خرید</strong></div></span><span style=\"font-size: 10pt; font-family: Tahoma; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal;\"><div style=\"text-align: right;\">● &nbsp;با دانستن نام سازنده یک کالا و شماره مدل، شما می توانید ویژگی های این کالا را به صورت جز به جز با سایر کالاهای مشابه مقایسه کنید. بعضی از خرده فروشان کالا را به قیمتی که سایر رقبا عرضه می کنند، وارد بازار می کنند و یا حتی قیمت آن را پایین تر هم می آورند. بسیاری از بازرگان ها، نه همه آنها، امسال هزینه ای بابت خرید کالا پرداخت نمی کنند. پس بنابر این هزینه ارسال کالا را نیز در مجموع هزینه ها در نظر بگیرید. اگر شما در اینترنت سفارش خرید می دهید و محل فروشگاه را انتخاب می کنید، هزینه پارکینگ و حمل و نقل عمومی را نیز در نظر بگیرید.</div></span><span style=\"font-size: 10pt; font-family: Tahoma; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal;\"><div style=\"text-align: right;\">&nbsp;</div></span><span style=\"font-size: 10pt; font-family: Tahoma; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; color: rgb(0, 0, 255);\"><div style=\"text-align: right;\"><strong>6- آیا باید خرید خود را از طریق شبکه &nbsp;WiFi عمومی (شبکه ای که رمز ندارد) انجام دهید؟</strong></div></span><span style=\"font-size: 10pt; font-family: Tahoma; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal;\"><div style=\"text-align: right;\">● &nbsp;فکر نکنید که نقاط دسترسی WiFi عمومی امن هستند. تا زمانی که مطمئن نشوید که یک نقطه دسترسی ابزارهای امنیتی موثر و کافی دارد، ممکن است نخواهید اطلاعات حساس خود مانند شماره کارت اعتباری تان را از طریق آن شبکه ارسال کنید.&nbsp;</div></span><span style=\"font-size: 10pt; font-family: Tahoma; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal;\"><div style=\"text-align: right;\">&nbsp;</div></span><span style=\"font-size: 10pt; font-family: Tahoma; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; color: rgb(0, 0, 255);\"><div style=\"text-align: right;\"><strong>7- مبالغ را از طریق کارت اعتباری یا کارت هزینه پرداخت کنید.</strong></div></span><span style=\"font-size: 10pt; font-family: Tahoma; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal;\"><div style=\"text-align: right;\">&nbsp;این ابزارها از بهترین و اثر گذارترین روش ها برای محافظت و حمایت از استفاده کننده می باشد .</div></span><span style=\"font-size: 10pt; font-family: Tahoma; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal;\"><div style=\"text-align: right;\">● ارسال پول از طریق سیستم مخابراتی می تواند ریسک داشته باشد. همانند ارسال وجه نقد، اگر یک بار ارسال شود، دیگر ارسال شده است. شما نمی توانید آن را برگردانید.</div></span><span style=\"font-size: 10pt; font-family: Tahoma; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal;\"><div style=\"text-align: right;\">● &nbsp;خرید در اینترنت و استفاده از ابزارهای شبه نقد مانند چک شخصی و.... می تواند ریسک داشته باشد. تنها زمانی از این ابزارها استفاده کنید که شخصی که با او معامله می کنید، را می شناسید.&nbsp;</div></span><span style=\"font-size: 10pt; font-family: Tahoma; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal;\"><div style=\"text-align: right;\">&nbsp;</div></span><span style=\"font-size: 10pt; font-family: Tahoma; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; color: rgb(0, 0, 255);\"><div style=\"text-align: right;\"><strong>8- محصولات رایگان می توانند هزینه زا باشند.</strong></div></span><span style=\"font-size: 10pt; font-family: Tahoma; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal;\"><div style=\"text-align: right;\">&nbsp;● &nbsp;محافظ صفحه، کارت های الکترونیک و سایر دانلودها در فضای اینترنت می توانند، حامل ویروس های خطرناک باشند. نرم افزارهای ضد ویروس و ضد جاسوسی خود را همراه با نرم افزار دیواره آتش همواره به روز و فعال نگه دارید.&nbsp;</div></span><span style=\"font-size: 10pt; font-family: Tahoma; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal;\"><div style=\"text-align: right;\">&nbsp;</div></span><span style=\"font-size: 10pt; font-family: Tahoma; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; color: rgb(0, 0, 255);\"><div style=\"text-align: right;\"><strong>9- حساب های مالی خود را به دقت بررسی کنید.</strong></div></span><span style=\"font-size: 10pt; font-family: Tahoma; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; text-align: justify;\"><div style=\"text-align: right;\">● &nbsp;به صورت روزانه و مستمر حساب های خود را بررسی کنید تا مطمئن شوید &nbsp;تمامی برداشت های پول از حساب مطابق نظر خودتان صورت گرفته است .</div></span><span style=\"font-size: 10pt; font-family: Tahoma; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal;\"><div style=\"text-align: right;\"><span style=\"background-color: initial; text-transform: uppercase;\"><br></span></div></span><p style=\"font-size: 10pt; font-family: Arial, Verdana; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal;\"></p><hr id=\"null\" style=\"font-size: 10pt; font-family: Arial, Verdana; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; text-align: right;\"><div style=\"font-size: 10pt; text-align: right;\"><span style=\"font-family: Arial, Verdana; font-size: 13.3333px;\"><br></span></div><p style=\"font-size: 12px; font-family: Arial, Verdana; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; box-sizing: border-box; color: rgb(0, 84, 96); background-color: rgb(255, 255, 255);\"><span style=\"font-family: Tahoma;\"></span></p><div style=\"font-size: 10pt; font-family: Arial, Verdana; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; text-align: right;\"></div><h2 style=\"text-align: center; font-family: Arial, Verdana; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal;\"><span style=\"background-color: initial; text-transform: uppercase; font-size: x-large;\">امنیت خرید های آنلاین</span></h2><div style=\"font-family: Arial, Verdana; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; text-align: center;\"><div style=\"text-align: center;\"><span style=\"font-family: Tahoma, sans-serif; text-align: justify; font-size: 10pt;\">خرید آنلاین کالاها و خدمات، از با ارزش‌ترین خدماتی است که بر روی اینترنت ارائه می‌شود. این امر علاوه بر صرفه‌جویی در وقت کاربران، مزایایی چون افزایش امنیت در جابجایی پول، کاهش هزینه‌های بازاریابی، صرفه‌جویی اقتصادی و افزایش فرصت‌های شغلی و کارآفرینی را به دنبال دارد. امّا در عین حال کلاهبرداران فضای مجازی نیز با استفاده از عدم اطّلاع یا کم‌دقّتی خریداران و مشتریان، آن را با تهدیدها و آسیب‌هایی مواجه ساخته‌اند. نکات ذیل را در هنگام خریدهای الکترونیکی در نظر داشته باشید.</span></div><span style=\"font-size: 10pt; font-family: Tahoma, sans-serif; text-align: justify;\"><div style=\"text-align: right;\"><span style=\"font-size: 10pt;\">-&nbsp;اوّلین پیش‌فرض برای حقیقی و سالم بودن خدمات یک فروشگاه الکترونیک، این است که کالاهای مجاز ارائه می‌کند. بنابر این فروشگاه‌هایی که کالاهای غیرمجاز به فروش می‌رسانند، با احتمال بسیار بالا، به قصد کلاهبرداری به وجود آمده‌اند.</span></div></span><span style=\"font-size: 10pt; font-family: Tahoma, sans-serif; text-align: justify;\"><div style=\"text-align: right;\"><span style=\"font-size: 10pt;\">-&nbsp;در هنگام تصمیم به خرید از فروشگاه‌های الکترونیکی، از تجربه‌ی دوستان و آشنایان نزدیک در خصوص خریدهای آنلاین استفاده کنید و از فروشگاه‌هایی که سابقه‌ی ارائه‌ی خدمات مطلوب دارند، خرید کنید.</span></div></span><span style=\"font-size: 10pt; font-family: Tahoma, sans-serif; text-align: justify;\"><div style=\"text-align: right;\"><span style=\"font-size: 10pt;\">-&nbsp;صفحاتی که ناخواسته در برابر شما باز می‌شوند و حاوی تبلیغات فروش کالاها و ارائه‌ی خدمات هستند، ممکن است تقلّبی بوده و قصد کلاهبرداری داشته باشند.</span></div></span><span style=\"font-size: 10pt; font-family: Tahoma, sans-serif; text-align: justify;\"><div style=\"text-align: right;\"><span style=\"font-size: 10pt;\">-&nbsp;سعی کنید در هنگام خرید آنلاین، با روش‌هایی نظیر گرفتن Who is از دامنه‌ی سایت اینترنتی فروشگاه، یا جستجو در انجمن‌هایی که اعضای آن‌ها، تجربیات خرید آنلاین خود را برای اطّلاع سایر اعضا می‌نویسند، از مدیر و گردانندگان فروشگاه، احراز هویّت کنید.</span></div></span><span style=\"font-size: 10pt; font-family: Tahoma, sans-serif; text-align: justify;\"><div style=\"text-align: right;\"><span style=\"font-size: 10pt;\">-&nbsp;در هنگام خرید آنلاین و در زمانی که پس از انتخاب کالا به درگاه پرداخت الکترونیکی بانک رهنمون می‌شوید، دقّت کنید که حتماً آدرس صفحه‌ی درگاه پرداخت الکترونیکی، متعلّق به همان بانکی باشد که آرم و لوگوی آن را در صفحه مشاهده می‌کنید.</span></div></span><span style=\"font-size: 10pt; font-family: Tahoma, sans-serif; text-align: justify;\"><div style=\"text-align: right;\"><span style=\"font-size: 10pt;\">-&nbsp;در بعضی از مواقع کلاهبرداران با جعل صفحات درگاه پرداخت الکترونیکی بانک‌ها، شما را به صفحاتی هدایت می‌کنند که آدرسی بسیار شبیه آدرس بانک اصلی دارند. در صورت عدم دقّت خریدار و ورود اطّلاعات کارت بانکی خود شامل شماره‌ی کارت، رمز عبور، CVV2 و تاریخ انقضای کارت، این اطّلاعات را در سیستم خود ثبت کرده و عملاً امکان هرگونه اقدامی را با حساب و موجودی قربانی دارند.</span></div></span><span style=\"font-size: 10pt; font-family: Tahoma, sans-serif; text-align: justify;\"><div style=\"text-align: right;\"><span style=\"font-size: 10pt;\">-&nbsp;سیستم پرداخت الکترونیکی همه‌ی بانک‌ها از SSL و روش‌های مطمئن رمزنگاری استفاده می‌کند. دقّت کنید که در نوار آدرس کنار آدرس اینترنتی صفحه‌ی پرداخت بانک، نماد یک قفل یا عبارت https:// درج شده باشد. در غیر این ‌صورت قطعاً صفحه جعلی است و قصد به سرقت بردن اطّلاعات کارت بانکی شما را دارد.</span></div></span><span style=\"font-size: 10pt; font-family: Tahoma, sans-serif; text-align: justify;\"><div style=\"text-align: right;\"><span style=\"font-size: 10pt;\">-&nbsp;مرکز توسعه‌ی تجارت الکترونیکی وزارت بازرگانی، با همکاری نیروی انتظامی جمهوری اسلامی ایران در جهت افزایش امنیت خدمات تجارت الکترونیک، اعطای نماد اعتماد الکترونیکی به فروشگاه‌های الکترونیک را آغاز کرده‌است تا خریداران به راحتی و با آسودگی خاطر خرید خود را انجام دهند. ترجیحاً از فروشگاه‌هایی که دارای این نماد هستند، خرید کنید.</span></div></span></div><div style=\"font-size: 10pt; text-align: right; font-family: Arial, Verdana; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal;\"><br></div><div style=\"font-size: 10pt; font-family: Arial, Verdana; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; text-align: right;\"><span style=\"background-color: initial; text-transform: uppercase;\"><br></span></div><div style=\"font-size: 10pt; text-align: center; font-family: Arial, Verdana; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal;\"><span style=\"background-color: initial; text-transform: uppercase;\">.</span><a href=\"https://www.cyberpolice.ir\" style=\"background-color: initial; text-align: center;\">لینک وبسایت پلیس فتا</a></div><p style=\"font-size: 10pt; font-family: Arial, Verdana; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal;\"></p>','0000-00-00 00:00:00','0000-00-00 00:00:00'),(14,'راهنما و سوالات متدوال','help','<h1>راهنما و سوالات متداول استفاده از اکسکوینو</h1>\n\n<h3><strong>- از کجا شروع کنم؟</strong></h3>\n\n<p>برای شروع خرید و فروش ، شما باید بعد از ثبت نام و فعال سازی حساب کاربری خود ، وارد بخش احراز هویت شوید و اطلاعات خواسته شده را در بخش احراز هویت تکمیل کنید تا حساب شما فعال شود.</p>\n\n<p>برای شروع ارزهای دیجیتال مانند بیت کوین و اتریوم ابتدا باید یک کیف پول مخصوص ارزهای دیجیتال بسازید. ما برای راحتی شما 2 تا از معتبرترین سایت ها رو معرفی میکنیم:</p>\n\n<p><br />\n<a href=\"https://goo.gl/zy5zsY\">1- آموزش ساخت کیف پول در سایت COINPAYMENT</a>زبان فارسی دارد<br />\n<a href=\"https://www.coinpayments.net/index.php?ref=b43a5804533ed4812c18840a499861f6\">COINPAYMENT.NET</a>&nbsp;سایت اصلی</p>\n\n<p><br />\n<a href=\"https://goo.gl/kES2sW\">2- آموزش ساخت کیف پول در سایت BINANCE</a></p>\n\n<p><a href=\"https://www.binance.com/?ref=17198903\">BINANCE.COM</a>&nbsp;سایت اصلی</p>\n\n<p>&nbsp;</p>\n\n<h3><strong>- احراز هویت چیست ؟</strong></h3>\n\n<p>با توجه به بیشتر شدن موارد کلاهبرداری از طریق اینترنت و سوء استفاده از اطلاعات کارت بانکی ، کارت ملی و سایر مدارک شناسایی دیگران و هچنین به توصیه ی &quot; پلیس فتا &quot; ، برای جلوگیری از این موارد ، کاربران باید بعد از ثبت نام در سایت برای خرید و فروش یکبار مراحل احراز هویت رو انجام بدهند .</p>\n\n<p>سپس بعد از انجام احراز هویت و تایید اطلاعات ثبت شده،کاربر می تواند عملیات خرید و فروش رو در سایت فقط و فقط با اطلاعات کارت بانکی ثبت شده در سایت و به اسم همان کاربر انجام دهد. در صورت استفاده از کارت های بانکی دیگر افراد، سایت موظف به دریافت اطلاعات بیشتر از کاربر برای تایید اطلاعات می باشد.</p>\n\n<p>در صورت مشاهده هرگونه سوء استفاده از اطلاعات دیگران. سایت اکسکوینو موظف به ارائه اطلاعات کاربر خاطی به &quot; پلیس فتا &quot; برای پیگیری های بیشتر می باشد.</p>\n\n<p>&nbsp;</p>\n\n<h3><strong>- خرید و فروش چگونه است ؟</strong></h3>\n\n<p>برای خرید و فروش شما باید وارد صفحه اول حساب کاربری یا داشبورد شوید.&nbsp;</p>\n\n<p>در این قسمت پنل خرید و فروش را مشاهده میکنید. فرض کنید شما قصد خرید اتریوم دارید: برای خرید اتریوم قسمت پرداخت میکنید را روی &quot;ریال&quot; و بخش دریافت میکنید را روی &quot;ethereum&quot; قرار میدید. حالا توی کادر مربوطه میتوانید معادل ریالی یا اتریوم درخواستی خود را وارد کنید. با تکمیل هر طرف ، طرف دیگر به صورت اتوماتیک تغیرر و معادل ارز درخواستی نشان داده می شود. بعد از انتخاب مقدار درخواستی روی سفارش کلیک کنید.&nbsp;</p>\n\n<p>در پنجره جدید شما باید ادرس کیف پول خودتون&nbsp; را وارد کنید ، سپس با کلیک روی تایید قوانین سایت میتوانید وارد بخش بعد شوید.</p>\n\n<p>&nbsp;</p>\n\n<p>در بخش بعد پیش فاکتور برای شما نشان داده می شود و اطلاعات سفارش + مبلغ کارمزد و خالص دریافتی را نشان می دهد. بعد از تایید پیش فاکتور وارد درگاه بانک شده و سفارش را پرداخت میکنید. بعد از پرداخت سفارش، اگر با کارت های مجاز خودتون خحرید کرده باشید. سفارش از طرف سایت انجام خواهد شد.</p>\n\n<p>&nbsp;</p>\n\n<p>فروش:</p>\n\n<p>برای فروش به اکسکوینو در پنل خرید فروش دریافت میکنید را روی ریال قرار بدید و پرداخت میکنید را برای مثال روی بیت کوین، حالا مقداری که دقیقا میخواهید بفروشید را وارد کنید ، دقت کنید مبلغی که دقیقا میتوانید ارسال کنید را وارد کنید ( کارمزد ارسال از کیف پول شما باید جدا گانه حساب شود) و شما باید دقیقا مبلغ سفارش را به حساب ما واریز کنید.</p>\n\n<p>بعد از انتخاب مقدار روی سفارش کلیک کرده. و در کادر های مشخص شماره 24 رقمی شبا و اسم خودتون را وارد کرده و وارد مرحله بعد شوید. در مرحله بعد پیش فاکتور نمایش داده میشود ، با تایید پیش فاکتور یک ادرس بیت کوین به شما نمایش داده می شود و شما باید مبلغی که قصد فروش داشته اید را به ان ادرس ارسال کنید. بعد از دریافت ارز شما توسط ادرس ما ، سفارش فعال و معادل ریالی در اولین روز کاری از&nbsp; طریق سیستم پایا برای شما ارسال میگردد.</p>\n\n<p>&nbsp;</p>\n\n<h3><strong>چه زمانی مبلغ ریالی را دریافت می کنم؟</strong></h3>\n\n<p>واریز های ریالی از طرف ما (درخواست فروش به سایت یا برداشت ریالی از طرف شما) روزی سه مرتبه در روز های کاری و غیر تعطیل انجام میشود.</p>\n\n<p>به این صورت که سفارش های هر روز جمع اوری می شود. و در روز کاری بعد اول صبح&nbsp; واریز می شود. یعنی امروز اگر روز 10 ماه باشد سفارش های فروش به سایت یا درخواست های برداشت ریالی در این روز جمع اوری می شود و در روز یازدهم اگر روز کاری باشد مبلغ واریز می شود.</p>\n\n<p>واریز های ریالی به کاربران به صورت پایا می باشد. واریز های پایا با استفاده از شماره شبا انجام می شود.</p>\n\n<p>&nbsp;</p>\n\n<h2>چرا مقدار واریزی با مقداری که دریافت کردم متفاوت هست؟</h2>\n\n<p>شما وقتی سفارش را ثبت می کنید قبل از ورود به درگاه پرداخت یک پیش پرداخت مشاهده میکنید و مبلغی که کارمزد سایت هست رو مشاهده&nbsp; و با تایید وارد درگاه می شوید</p>','0000-00-00 00:00:00','0000-00-00 00:00:00');
