  `fee_to` varchar(191) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '0',
  `fee_to_balance` varchar(191) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '0',
  `platform` varchar(191) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `token` varchar(191) COLLATE utf8mb4_unicode_ci NOT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `used_at` timestamp NULL DEFAULT NULL,
  `expired_at` timestamp NULL DEFAULT NULL,
  `network_id` bigint(20) unsigned DEFAULT NULL,
  `from_currency_id` bigint(20) unsigned DEFAULT NULL,
  `from_price` decimal(30,15) NOT NULL,
  `from_amount` decimal(30,15) NOT NULL,
  `change_fee_source` decimal(30,15) NOT NULL DEFAULT 0.000000000000000,
