  `to_amount` decimal(30,15) NOT NULL,
  `transfer_fee_destination` decimal(30,15) NOT NULL DEFAULT 0.000000000000000,
  `transfer_fee_source` decimal(30,15) NOT NULL DEFAULT 0.000000000000000,
  `rial_price` decimal(30,15) NOT NULL DEFAULT 0.000000000000000,
  PRIMARY KEY (`id`),
  UNIQUE KEY `order_tokens_token_unique` (`token`),
  KEY `order_tokens_from_currency_id_foreign` (`from_currency_id`),
  KEY `order_tokens_to_currency_id_foreign` (`to_currency_id`),
  KEY `order_tokens_network_id_foreign` (`network_id`),
  CONSTRAINT `order_tokens_from_currency_id_foreign` FOREIGN KEY (`from_currency_id`) REFERENCES `currencies` (`id`),
  CONSTRAINT `order_tokens_network_id_foreign` FOREIGN KEY (`network_id`) REFERENCES `networks` (`id`),
  CONSTRAINT `order_tokens_to_currency_id_foreign` FOREIGN KEY (`to_currency_id`) REFERENCES `currencies` (`id`)
