  `from_amount` decimal(30,15) NOT NULL,
  `from_address` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `from_address_extra` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `is_from_balance` tinyint(1) NOT NULL DEFAULT 0,
  `to_currency_id` bigint(20) unsigned NOT NULL,
  `to_amount` decimal(30,15) NOT NULL,
  `to_address` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `to_address_extra` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `description` varchar(191) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `is_to_balance` tinyint(1) NOT NULL DEFAULT 0,
  `system_address` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `system_address_extra` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `network_fee` decimal(30,15) NOT NULL DEFAULT 0.000000000000000,
