  `transfer_fee` decimal(30,15) NOT NULL DEFAULT 0.000000000000000,
  `rate_profit` decimal(30,15) NOT NULL DEFAULT 0.000000000000000,
  `is_fee_from_source` tinyint(1) NOT NULL DEFAULT 0,
  `BCEQ` decimal(30,15) NOT NULL,
  `rial_equivalent` decimal(30,15) NOT NULL DEFAULT 0.000000000000000,
  `ip` varchar(20) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `agent` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `from_app` tinyint(1) NOT NULL DEFAULT 0,
  `is_autopaid` tinyint(1) NOT NULL DEFAULT 0,
  `previous_status` enum('CREATED','BANK_PAYMENT','CRYPTO_PAYMENT','NEED_VERIFICATION','PROCESSING','PROCESSED','EXPIRED','REFUSED','CANCELED','UNMATCHED_CARD','NEGATIVE_BALANCE','UNMATCHED_BALANCE','MANUAL_PROCESSING','AUTO_PAYING','MANUAL_PAYING','SUSPENDED') COLLATE utf8mb4_unicode_ci NOT NULL,
