  KEY `orders_to_currency_id_foreign` (`to_currency_id`),
  KEY `orders_order_token_id_foreign` (`order_token_id`),
  CONSTRAINT `orders_from_currency_id_foreign` FOREIGN KEY (`from_currency_id`) REFERENCES `currencies` (`id`),
  CONSTRAINT `orders_order_token_id_foreign` FOREIGN KEY (`order_token_id`) REFERENCES `order_tokens` (`id`),
  CONSTRAINT `orders_receiver_id_foreign` FOREIGN KEY (`receiver_id`) REFERENCES `ec_users` (`id`),
  CONSTRAINT `orders_to_currency_id_foreign` FOREIGN KEY (`to_currency_id`) REFERENCES `currencies` (`id`),
  CONSTRAINT `orders_user_id_foreign` FOREIGN KEY (`user_id`) REFERENCES `ec_users` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=455017 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
